Armed: A soldier prepares his weapon as his colleagues get ready for combat during a re-enactment. One SS trooper from the 17th SS PanzerGrenadier Division Florian Geyer armed with a MP-44 (Sturmgeweher) plus an Obergrefeiter who won the Iron Cross 1st and 2nd classes from a Heer PanzerGrenadier regiment (i believe his piping is light green at least) with an MG-42. Another Heer machinegunner with what appears to be an MG-34. A lot of firepower facing the Allies.
